class DeciPowerFactor(TextualConvention, Integer32):
    description = 'Data type for reporting measurements associated with power factor calculation. The power factor of an AC power system is defined as the ratio of the real or active power to the apparent power and is a number between 0 and 1. A DeciPowerFactor value is calculated by taking this ratio and multiplying by 1000. A power factor of 98.3% will be reported as 983. The power factor is used to indicate how efficiently a particular load is utilizing energy.'
    status = 'current'
    displayHint = 'd-2'

